import axios from "axios";
import React from "react";
import ReactDOM from 'react-dom'
import {Link} from "react-router-dom";
import { useState, useEffect } from "react";

import './style.css' 




const Qbcompare = () => {
  const [isLoading, setIsLoading] =useState(true);
  const [players, setPlayers] = useState ([]);

  useEffect (() => {
    axios.get('https://project.trumedianetworks.com/api/nfl/players', {
      headers: {
          'tempToken': 'd818a26a-a42d-4fc5-8ab7-44020a0dad5e',
        }
      })
      .then((res) => {
        setIsLoading(false)
        console.log(res.data);

      if (res.data) {

        setPlayers(res.data);
      }else{
        console.log('error')
      }
    })
    .catch(error => {
      setIsLoading(false)
      console.log('error', error);
    });

  }, []);

  const handleClick = () => {
    const [show, setshow] = useState(false);
    return(
    <div className="App">
      <button onClick={() => setShow(true)}>Show Modal</button>
        <Modal title="My Modal" onClose={() => setShow(false)} show={show}>
          <p>This is modal body</p>
        </Modal>
    </div>
    );
  };

  const playerList = players.map(player => {
  return (
    <div className="players" onClick={handleClick}>
      <p className="playername">{player.fullName}</p>
        <div className="playerimage">
          <img src={player.playerImage}></img> 
        </div>
    </div>
    )
})
  const content = isLoading  ? <div>Loading</div> : <div><pre>{playerList}</pre></div>
  console.log(players)

  return <h1>{content}</h1>


}

export default Qbcompare;
